function load_img() {

  for(i=0; i<$(".sun").length; i++) {
    $(".sun").children('img')[i].src=img_sun;
  }

  //생각해보니까 ㅋㅋㅋㅋ 사용자가 사진 올리게 하려면 이거 쓸모 없구나 ㅋㅋㅋㅋㅋㅋㅋㅋ 난 천재인 듯

  for(i=0; i<$(".night").length; i++) {
    $(".night").children('img')[i].src=img_night;
  }

  for(i=0; i<$(".shine-time").length; i++) {
    $(".shine-time").children('img')[i].src=img_shine2;
  }

  for(i=0; i<$(".waterdrop_time").length; i++) {
    $(".waterdrop_time").children('img')[i].src=img_waterdrop;
  }

  for(i=0; i<$(".logo-seoul").length; i++) {
    $(".logo-seoul").children('img')[i].src=img_s_dae;
  }

  for(i=0; i<$(".logo-korea").length; i++) {
    $(".logo-korea").children('img')[i].src=img_k_dae;
  }

  for(i=0; i<$(".logo-yonsei").length; i++) {
    $(".logo-yonsei").children('img')[i].src=img_y_dae;
  }


}

const img_sun = "data:image/png;base64,"

